import React from 'react';
import { Link, Route } from 'react-router-dom';
import { Introduction } from './Introduction';

const Introductions = ({match}) => {
    return (
        <div>
            <h2>Slide</h2>
            <ul>
                <li><Link to={`${match.url}/1`}>Slide 1</Link></li>
                <li><Link to={`${match.url}/2`}>Slide 2</Link></li>
                <li><Link to={`${match.url}/3`}>Slide 3</Link></li>
                <li><Link to={`${match.url}/4`}>Slide 4</Link></li>
            </ul>
            <Route exact path={match.url} render={() => (
                <h3>Presentation</h3>
            )}/>
            <Route path={`${match.url}/:id`} component={Introduction}/>
        </div>
    );
};

export default Introductions;
